import React, { useState } from 'react';

import Style from './addNewGoal.module.scss';
import { Button } from 'components';

export default function AddNewGoal() {
	const [nameInput, setNameInput] = useState('');
	const [categoryInput, setCategoryInput] = useState('');
	const [timesPerWeek, setTimesPerWeek] = useState(0);

	function handleNameInputChanged(e) {
		setNameInput(e.target.value);
	}

	async function addGoal(e) {
		try {
			e.preventDefault();
			console.log('ADDING NEW GOAL');
		} catch (e) {
			console.log(e);
		}
	}

	// function addGoal() {
	// 	console.log('YUPOOOO');
	// }

	return (
		<div className={Style.Container}>
			<h4>Add New Goal</h4>
			<form className={Style.form}>
				<div>
					<label htmlFor='goal'>Goal</label>
					<input
						type='text'
						name='goal'
						id='goal'
						value={this.state.nameInput}
						onChange={this.handleNameInputChanged.bind(this)}
					/>
				</div>
				<div>
					<label htmlFor='category'>Category</label>
					<select name='category' id='category'>
						<option value=''>--Select--</option>
						<option value='Fitness'>Fitness</option>
						<option value='Nutrition'>Nutrition</option>
						<option value='Mindfulness'>Mindfulness</option>
					</select>
				</div>
				<div>
					<label htmlFor='times'>Times per week</label>
					<input type='number' id='times' />
				</div>
				<button onClick={addGoal} className={Style.smallButton}>
					Submit
				</button>
			</form>
		</div>
	);
}
